const jsPDFInvoiceTemplate = require('jspdf-invoice-template-nodejs');



const propertyGenerator = ({items,customer,invoice_id,invoice_date,total_amount,tempFileName})=>{
	return {
		outputType: 'blob',
		returnJsPDFDocObject: true,
		fileName: tempFileName,
		orientationLandscape: false,
		compress: true,
		logo: {
			src: 'data:image/jpeg;base64,',
			type: 'PNG',
			width: 53.33, //aspect ratio = width/height
			height: 26.66,
			margin: {
				top: 0, //negative or positive num, from the current position
				left: 0, //negative or positive num, from the current position
			},
		},
		stamp: {
			inAllPages: true,
			src: 'data:image/jpeg;base64,',
			type: 'PNG',
			width: 20, //aspect ratio = width/height
			height: 20,
			margin: {
				top: 0, //negative or positive num, from the current position
				left: 0, //negative or positive num, from the current position
			},
		},
		business: {
			name: 'Business Name',
			address: 'Albania, Tirane ish-Dogana, Durres 2001',
			phone: '(+355) 069 11 11 111',
			email: 'email@example.com',
			email_1: 'info@example.al',
			website: 'www.example.al',
		},
		contact: {
			label: 'Invoice issued for:',
			name: `${customer?.customer_name}`,
			address: `${customer?.address}`,
			phone: `${customer?.phone}`,
			email: `${customer?.email}`,
			// otherInfo: 'www.website.al',
		},
		invoice: {
			label: 'Invoice #: ',
			num: parseInt(invoice_id),
			invDate: `Payment Date: ${invoice_date}`,
			invGenDate: `Invoice Date: ${invoice_date}`,
			headerBorder: false,
			tableBodyBorder: false,
			header: [
				{ title: '#', style: { width: 10 } },
				{ title: 'Name', style: { width: 30 } },
				{ title: 'Price' },
				{ title: 'Quantity' },
				{ title: 'Unit' },
				{ title: 'Total' },
			],
			table: items.map((item, index) => [
				index + 1,
				item.product_name,
				item.price,
				item.quantity,
				'm2',
				item.price * item.quantity,
			]),
			additionalRows: [
				{
					col1: 'Total:',
					col2: `${total_amount}`,
					col3: 'ALL',
					style: { fontSize: 14 },
				},
				{
					col1: 'VAT:',
					col2: '20',
					col3: '%',
					style: { fontSize: 10 },
				},
				{
					col1: 'SubTotal:',
					col2: '116,199.90',
					col3: 'ALL',
					style: { fontSize: 10 },
				},
			],
			invDescLabel: 'Invoice Note',
			invDesc:
				"There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don't look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn't anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary.",
		},
		footer: {
			text: 'The invoice is created on a computer and is valid without the signature and stamp.',
		},
		pageEnable: true,
		pageLabel: 'Page ',
	};

}


async function generatePDF(data) {
	try {
		
		const tempFileName = `invoice_${Date.now()}`;
		const props = propertyGenerator({...data, tempFileName});

		const pdfObject = jsPDFInvoiceTemplate.default(props);
		const blob = pdfObject.blob;

		const arrayBuffer = await blob.arrayBuffer();
		const buffer = Buffer.from(arrayBuffer);

		return {buffer,fileName: tempFileName + ".pdf"}
	} catch (error) {
		console.log(error);
	}
}

module.exports = {
	generatePDF,
};
